import React from "react";
import PostItem from "./posts";

export default function PostList(posts) {
    return(
        <div>
            <h2 style={{textAlign: 'center'}}>Список постов</h2>
            {posts.map(post=> 
                <PostItem post={post} key = {post.id}/>
                )}
        </div>
    )
}
